INSERT INTO tblExamDone (edpk, exanswer, stupk, ocpk, expk) VALUES ((SELECT NVL(MAX(edpk), 0) + 1 FROM tblExamDone),'RNN과 LSTM의 차이점 및 장단점 RNN은 이전 정보를 기억하면서 순차적 데이터를 처리하는 신경망으로, 각 시퀀스의 출력이 다음 입력 데이터에 영향을 미칩니다. 그러나 장기 의존성 문제(long-term dependencies)로 인해 실제로는 멀리 떨어진 정보를 학습하는 데 어려움이 있습니다. LSTM은 RNN의 한 종류로, 장기 의존성 문제를 해결하기 위해 ''게이트''라는 구조를 도입했습니다. 이 게이트를 통해 정보를 장기간 기억하거나 삭제할 수 있어, 보다 복잡한 패턴을 학습할 수 있습니다 .',125,6,17);
