INSERT INTO tblExamDone (edpk, exanswer, stupk, ocpk, expk) VALUES ((SELECT NVL(MAX(edpk), 0) + 1 FROM tblExamDone),'자기 지도 학습 및 예시 자기 지도 학습은 레이블이 없는 데이터를 사용하여 모델이 스스로 학습 데이터에 대한 분류나 특징을 찾아내는 학습 방식입니다. 이는 레이블링 비용을 절감할 수 있으며, 대량의 레이블이 없는 데이터에서도 학습이 가능합니다 .예시: BERT, GPT와 같은 언어 모델은 대량의 텍스트 데이터에서 문맥을 이해하고, 다음에 올 단어를 예측하는 등의 작업을 통해 자기 지도 학습을 수행합니다.',125,6,18);
