INSERT INTO tblExamDone (edpk, exanswer, stupk, ocpk, expk) VALUES ((SELECT NVL(MAX(edpk), 0) + 1 FROM tblExamDone),'Apache Kafka는 대용량 데이터 스트림을 신속하게 처리하고, 분산 시스템 간의 메시지 큐로서 기능하는 플랫폼입니다. 빅데이터 환경에서 실시간 데이터 처리와 높은 처리량이 요구되는 상황에서 Kafka는 효율적인 데이터 파이프라인 구축을 가능하게 합니다 .',125,6,46);
